  false,\n\t\"url\": null,\n\t\"notes\": \"This is a plan to obtain useful parameters
  related to the distribution, abundance, and population dynamics of the species of
  wildlife inhabiting Necedah NWR. The objectives of this plan are to (1) standardize
  inventory procedures, thereby increasing the accuracy of data collected; (2) provide
  guidelines specific to Necedah Refuge for the collection of wildlife population
  data; (3) provide necessary information to evaluate habitat management practices
  designed to accomplish refuge objectives; and (4) determine the estimated time required
  and associated costs of each inventory procedure.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
